func specialPerm(nums []int) int {
    n := len(nums)
    mod := 1000000007
    dp := make([][]int, 1<<n)
    for i := range dp {
        dp[i] = make([]int, n)
    }
    for i := 0; i < n; i++ {
        dp[1<<i][i] = 1
    }
    for mask := 0; mask < (1 << n); mask++ {
        for last := 0; last < n; last++ {
            if mask&(1<<last) == 0 {
                continue
            }
            for next := 0; next < n; next++ {
                if mask&(1<<next) == 0 && (nums[last]%nums[next] == 0 || nums[next]%nums[last] == 0) {
                    dp[mask|(1<<next)][next] = (dp[mask|(1<<next)][next] + dp[mask][last]) % mod
                }
            }
        }
    }
    result := 0
    for i := 0; i < n; i++ {
        result = (result + dp[(1<<n)-1][i]) % mod
    }
    return result
}
